import React from 'react';
import Image from 'react-image-resizer';
import logo from './logo.png'; // Tell Webpack this JS file uses this image

function Logo() {

    return (

        <Image
          className = "logohead" >
          img src={logo} alt="logo" 
          //src="./logo.png"
          height={100}
          width={200}
        </Image>
    );

}

export default Logo;
